import React from 'react';
import './App.css';

tabs = ["US", "World", "Politics", "Business", "Health", "Entertainment", "Opinion"];

function App() {
  return (
    <nav>
      <ul>
        <li>World</li>
        <li>Politics</li>
        <li>US</li>
        <li>Business</li>
        <li>Opinion</li>
        <li>Health</li>
        <li>Entertainment</li>
      </ul>
    </nav>
  );
}

export default App;
